import React from "react";
import { useImageData } from "../ImageProvider";

const Projects = () => {
    const { projectData, loading, error } = useImageData();

    return (
        <div className="w-full h-full flex justify-center items-center text-white">

            {projectData.map(project => (
                project.title !== 'banner' && (
                    <div key={project.title} className="w-1/3 h-1/2 bg-white m-4 text-black">
                        <img
                            className="object-cover w-full h-full"
                            src={`https://storage.googleapis.com/vkvrestauraties/${project.images[1]}`}
                            alt="project"
                        />
                    </div>
                )
            ))}

        </div>
    );
}

export default Projects;
